  client.hset('HolbertonSchools', 'Cali', 40, redis.print);
  client.hset('HolbertonSchools', 'Paris', 2, redis.print);
};

const displayHash = () => {
  client.hgetall('HolbertonSchools', (error, reply) => {
    if (error) {
      console.error(error);
    } else {
      console.log(reply);
    }
  });
};

